			// 	'about_me': {
			// 		'ru': 'Я Кузьма, мне 15 лет. <br> Начинающий Front-end разработчик. Увлекаюсь веб-программированием около года.',
			// 		'en': 'Im Kuzma, me 15 years old. <br> Beginner Front-end developer. I have been interested in web programming for about a year.',
