			// 	'technologies': {
			// 		'ru': 'Технологии: MySQL, Git, AJAX, React, React-router',
			// 		'en': 'Technologies: MySQL, Git, AJAX, React, React-router',
			// 	},
			// 	'feedback': {
			// 		'ru': 'Обратная связь',
			// 		'en': 'Feedback',
			// 	},
			// 	'groups': {
			// 		'ru': 'Мои группы',
			// 		'en': 'My groups',
			// 	},
			// 	'portfolio': {
			// 		'ru': 'Мое портфолио',
			// 		'en': 'My portfolio',
			// 	},
			// 	'personal_contacts': {
			// 		'ru': 'Личные ',
			// 		'en': 'Personal ',
			// 	},
			// 	'groups_contacts': {
